lumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2112941","type":"CustomJS"},{"attributes":{},"id":"2112580","type":"SaveTool"},{"attributes":{},"id":"2112564","type":"LinearScale"},{"attributes":{"line_color":"red","line_width":2,"x":{"field":"x"},"y":{"value":1.0168333560363798}},"id":"2112718","type":"Line"},{"attributes":{"line_alpha":{"value":0.2},"line_color":{"value":"#bbbbbb"},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"2112842","type":"Segment"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"2112818","type":"BoxAnnotation"},{"attributes":{"factors":["0","1"],"palette":["tomato","lime"]},"id":"2112592","type":"CategoricalColorMapper"},{"attributes":{"source":{"id":"2112590"}},"id":"2112857","type":"CDSView"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"2112812","type":"WheelZoomTool"},{"attributes":{},"id":"2112892","type":"LinearScale"},{"attributes":{"bottom":{"field":"Close"},"fill_color":{"field":"inc","transform":{"id":"2112592"}},"top":{"field":"Open"},"width":{"value":0.8},"x":{"field":"index"}},"id":"2112859","type":"VBar"},{"at
